// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract RabbitHole {
    struct Player {
        address player;
        uint256 fuel;
        uint256 speed;
    }

    uint256 numOfplayers = 2;

    mapping(uint256 => Player) private players;

    constructor() {
        players[0].fuel = 50;
        players[0].speed = 5;
        players[1].fuel = 50;
        players[1].speed = 6;
    }

    function setPlayerSpeed(uint256 speed) public {
        players[numOfplayers].fuel = 50;
        players[numOfplayers].speed = speed;
        players[numOfplayers].player = msg.sender;
        numOfplayers++;
    }

    function getPlayer(uint256 index) public view returns(Player memory) {
        return players[index];
    }

    function calculatePosition() public view {
        uint256 speed = 0;
        uint256 index = 0;
        for (uint256 i = 0;i < numOfplayers; i ++) {
            if (players[i].speed > speed) {
                speed = players[index].speed;
                index = i;
            }
        }
    }
}

